post_text:
Nominations are open for the sixth annual Distinguished Alumnus awards. Candidates need to meet the following requirements:

• Graduate of Hermiston High School, having attended for at least two consecutive years prior to graduation;
• A leader in his/her chosen field/profession, with a proven record of achievement and at least 10 years verifiable and successful professional experience;
• A strong supporter of and contributor to community service;
• Willing to serve as a role model for youth;
• A model citizen with a clean background free of criminal convictions; and,
• Supported by strong references and/or endorsements.

If you would like to nominate someone, please complete and submit the attached form by December 13. Thank you!

