post_text:
Please note that the information below was originally done in Spanish.

Las nominaciones están abiertas para el sexto premio anual al Alumno Distinguido. Los candidatos aspirantes deben reunir los siguientes requisitos:

• Debe ser graduado de la Preparatoria de Hermiston, haber asistido a HHS por lo menos dos años consecutivos antes de la graduación.
• Un líder en su elegida área/profesión, con un historial que muestre logro y tener por lo menos 10 años de experiencia profesional comprobable y exitosa;
• Un firme Defensor y colaborador del servicio comunitario;
• Inspira excelencia en otros al servir como buen ejemplo para la juventud;
• Conducta ejemplar y un ciudadano modelo; y
• Respaldado por buenas referencias y/o endosos.

Si desean nominar a alguien, por favor complete y entregue la forma adjunta antes del 13 de diciembre. ¡Muchas gracias!

Por favor sepa que, si usa una aplicación para traducir este mensaje, le proveerá una traducción literal, y el mensaje puede ser malinterpretado.

